script: |
  super -f text -I q1255.spq | sort > q1255.out

inputs:
  - name: q1255.spq
    data: |
      SELECT DISTINCT + - col1 * ( col1 ) + + cor0.col0 / ( 69 ) AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q1255.out
    data: |
      -7396
      -8280
      -9409
